package coderbyte.stringChallenge;

import java.util.HashMap;
import java.util.Map;

public class StringChallenge {
    public static String StringChallenge(String str) {
        // create variables to hold the result and a map of token characters to be removed from the result
        StringBuilder result = new StringBuilder();
        final String challengeToken = "j2p75643f";
        Map<Character, Character> tokenMap = new HashMap<>();

        // fill the map with the token characters
        for(char c : challengeToken.toCharArray()) {
            tokenMap.put(c, c);
        }

        // reverse the string and also remove characters appearing in the token map
        for(int i=str.length()-1; i>=0; i--) {
            char currentChar = str.charAt(i);
            // check if the character is in the map, if yes then dont add else add it to the result
            if (tokenMap.get(currentChar) == null) {
                result.append(currentChar);
            }
        }

        return result.toString().isEmpty()? "EMPTY": result.toString();
    }

    public static String StringChallenge2(String str) {
        // Reversing the string
        StringBuilder reversed = new StringBuilder(str).reverse();

        // Defining ChallengeToken
        String challengeToken = "j2p75643f";

        // Removing characters from ChallengeToken from reversed string
        for (int i = 0; i < challengeToken.length(); i++) {
            char tokenChar = challengeToken.charAt(i);

            // Removing characters (case-insensitive)
            reversed = new StringBuilder(reversed.toString().replaceAll("(?i)" + Character.toString(tokenChar), ""));
        }

        // If the final string is empty, return "EMPTY"
        if (reversed.toString().isEmpty()) {
            return "EMPTY";
        }
        return reversed.toString();
    }

    public static void main (String[] args) {
        System.out.println(StringChallenge("coderbyte"));
        System.out.println(StringChallenge("I Love Code"));

        testExecutionTime();
        testExecutionTime2();
    }

    static void testExecutionTime() {
        long startTime = System.currentTimeMillis();

        String result = StringChallenge("\n");
        long executionTime = System.currentTimeMillis() - startTime;

        System.out.println("Oddy executed in "+executionTime+"ms ");
    }

    static void testExecutionTime2() {
        long startTime = System.currentTimeMillis();

        String result = StringChallenge2("\n");
        long executionTime = System.currentTimeMillis() - startTime;

        System.out.println("Charlse executed in "+executionTime+"ms ");
    }
}
